  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Presquile National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1955.
  The report begins by summarizing the weather conditions, water conditions, and food
  and cover during this period. Wildlife- including migratory birds, upland game birds,
  big game animals, predators, rodents, raptors, and fish- is also covered. The Refuge
  development and maintenance section discusses physical developments, plantings,
  and wildfires. The public relations section of the report describes Refuge visitors
  and Refuge participation. Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
